import React from 'react';


class Signup extends React.Component {
  render() {
    return(
      <div>
        <h1>Welcome to signup</h1>
        <form>
          <TextInput
            name="name"
            label="name"
          />
          <TextInput
            name="email"
            label="email"
          />
          <input
            type="submit"
            className="ui button"
          />
        </form>
      </div>
    )
  }
}

export default Signup;
